import HomePage from './pages/HomePage.js';
import { BrowserRouter, Routes, Route } from 'react-router-dom';

function App() {
  return (
    <BrowserRouter>
      <HomePage />
      <Routes>
        <Route path='/' exact/>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
